import $ from "jquery";

$(document).ready(function() {
    var ammount = 0;
  $.ajax({
    type: "GET",
    url: "http://localhost:4242/api/1.0/get",
    success: function(response) {
      console.log(response)
    },
    error: function() {}
  });
});
